import React from "react";

import python from "../assets/logos/python.svg";
import typescript from "../assets/logos/ts.svg";
import javascript from "../assets/logos/js.svg";
import java from "../assets/logos/java.svg";
import sql from "../assets/logos/sql.svg";
import react from "../assets/logos/react.svg";
import redux from "../assets/logos/redux.svg";
import angular from "../assets/logos/angular.svg";
import firebase from "../assets/logos/firebase.svg";
import nodejs from "../assets/logos/nodejs.svg";
import jakartaee from "../assets/logos/jakartaee.svg";
import git from "../assets/logos/git.svg";
import figma from "../assets/logos/figma.svg";

const Skills = () => {
  return (
    <div>
      <img src={python} alt="profile" className="logo" />
      <img src={typescript} alt="profile" className="logo" />
      <img src={javascript} alt="profile" className="logo" />
      <img src={java} alt="profile" className="logo" />
      <img src={sql} alt="profile" className="logo" />
      <img src={react} alt="profile" className="logo" />
      <img src={redux} alt="profile" className="logo" />
      <img src={angular} alt="profile" className="logo" />
      <img src={nodejs} alt="profile" className="logo" />
      <img src={jakartaee} alt="profile" className="logo" />
      <img src={firebase} alt="profile" className="logo" />
      <img src={git} alt="profile" className="logo" />
      <img src={figma} alt="profile" className="logo" />

    </div>
  );
};

export default Skills;
